            if (storedValues[i].match(/.+?|#\d+?/) && storedValues[i].indexOf("currentSet") === -1 && storedValues[i].indexOf("actionMage") === -1){
                GM_setValue(storedValues[i] + plIdSubKey, GM_getValue(storedValues[i]));
                GM_deleteValue(storedValues[i]);
            }
